// Lấy accessToken từ response JSON và lưu vào biến toàn cục
const jsonData = pm.response.json();
if (jsonData.payload && jsonData.payload.accessToken) {
    pm.environment.set("accessToken", jsonData.payload.accessToken);
    pm.environment.set("refreshToken", jsonData.payload.refreshToken);
    console.warn("Đã thêm token vào môi trường!");
} else {
    console.warn("Không tìm thấy accessToken trong payload!");
}
